import Dashboard from "views/Dashboard.js";
import AddLibro from "views/AddLibro.js";
import ListaLibros from "views/ListaLibros";
import BuscarLibro from "views/BuscarLibro";
import AddAutor from "views/AddAutor.js";
import ListaAutores from "views/ListaAutores.js";
import BuscarAutor from "views/BuscarAutor.js";
import Cupones from "views/Cupones.js"; // Asegúrate de importar el componente de Cupones

var dashRoutes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "design_app",
    component: Dashboard,
    layout: "/admin",
    sidebar: true, // Esta ruta aparecerá en el sidebar
  },
  {
    path: "/add-libro",
    name: "Agregar Libro",
    icon: "education_agenda-bookmark",
    component: AddLibro,
    layout: "/admin",
    sidebar: true, // Esta ruta aparecerá en el sidebar
  },
  {
    path: "/lista-libros",
    name: "Lista de Libros",
    icon: "files_paper",
    component: ListaLibros,
    layout: "/admin",
    sidebar: true, // Esta ruta aparecerá en el sidebar
  },
  // Otras rutas...
  {
    path: "/cupones",
    name: "Cupones",
    icon: "design_bullet-list-67",
    component: Cupones,
    layout: "/admin",
    sidebar: false, // Esta ruta no aparecerá en el sidebar
  },
];

export default dashRoutes;
